import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Header from "./components/Header";
import ListofJobs from "./webpages/ListofJobs";
import JobDetails from "./webpages/JobDetails";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <Routes>
        <Route path="/ exact element=(<ListofJobs />)"></Route>
        <Route path="/jobs/post exact element=(<JobDetails />)"></Route>

        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
